import React from 'react';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import '../styles/App.css';
import Login from "./Login";
import '../styles/App.css';

export default function Router () {
    return (
        <BrowserRouter>
            <div>
                <Routes>
                    <Route path="/" element={<Login />} />
                </Routes>
            </div>
        </BrowserRouter>
    );
};
